import { FaSistrix } from "react-icons/fa";
import './style.css';

function App() {
  return (
    <div className="container">
      <h1>buscador de cep</h1>

      <div className="containerinput">
        <input type="text"

        placeholder="Digite seu Cep..."/>

        <button className="buttonSearch">
        <FaSistrix size={25} color="#fff"/>
        </button>

      </div>

      <main className="main">
        <h2>cep 12123123</h2>

        <span>ruas teste</span>
        <span>complemento:lagum complemento</span>
        <span>vila rosa</span>
        <span>campo grande-rs</span>

      </main>
    </div>
  );
}

export default App;
